import { CHARACTER_PATH } from "../globals"

const CharacterList = (props) => {
    return (
        <div className="grid">
            {
                props.characters.map((character) => (
                    <div className="card" key={character.id}>
                        <img src={`${CHARACTER_PATH}${character.image}`} alt={`${CHARACTER_PATH}${character.name}`} />
                    </div>
                ))
            }

        </div>
    )

}

export default CharacterList
